import React from 'react';
import {withRouter} from 'react-router-dom'

class Lawlist extends React.Component{
    constructor(props){
        super(props)
        this.clickHandler = this.clickHandler.bind(this)
    }
    clickHandler(event){
        event.preventDefault()
        let path = '/'
        this.props.history.push(path)
    }
    render(){
        return(
            <center>
                <div class="btn-group btn-group-lg" role="group" aria-label="Select the law you want to compare.">
                    <button type="button" class="btn btn-secondary">First</button>
                    <button type="button" class="btn btn-secondary">Second</button>
                    <button type="button" class="btn btn-secondary">Third</button>
                </div>
            </center>
        )
    }
}

export default withRouter(Lawlist)
